import torch
import sys
import os
import numpy as np

from numba import jit
class RBM():

    """
    num_visible - number of visible units
    num_hidden - number of hidden units
    k - number of cycles to use in contrastive divergence while training
    """
    def __init__(self, num_visible, num_hidden, k, learning_rate=1e-3,
    use_momentum=False, momentum_coefficient=0.5, decay_type='L2',
    weight_decay=1e-4, device='cpu', outbits=None, zeros=None):
        self.device = device

        self.num_visible = num_visible
        self.num_hidden = num_hidden
        self.k = k

        self.learning_rate = learning_rate
        self.decay_type = decay_type
        self.use_momentum = use_momentum
        self.momentum_coefficient = momentum_coefficient
        self.weight_decay = weight_decay

        self.sigmoid = torch.nn.Sigmoid()
        # self.sigmoid = torch.nn.ReLU()

        self.weights = torch.randn(num_visible, num_hidden, device=torch.device(self.device)) * 0.5
        self.visible_bias = torch.ones(num_visible, device=torch.device(self.device)) * 0.5
        self.hidden_bias = torch.zeros(num_hidden, device=torch.device(self.device)) *1


        if use_momentum:
            self.weights_momentum = torch.zeros(num_visible, num_hidden, device=torch.device(self.device))
            self.visible_bias_momentum = torch.zeros(num_visible, device=torch.device(self.device))
            self.hidden_bias_momentum = torch.zeros(num_hidden, device=torch.device(self.device))


        self.pcd_visible = 0
        self.pcd_hidden = 0

        if outbits is None:
            self.outbits = torch.arange(self.num_visible, device=torch.device(self.device), dtype=torch.long)
        #copies over from other tensor
        elif type(outbits) == torch.Tensor:
            self.outbits = outbits.long().clone().detach()
        else:
            self.outbits = torch.LongTensor(outbits, device=torch.device(self.device))

        if zeros is None:
            self.zeros = torch.Tensor([]).long()
            self.zeros = self.zeros.to(torch.device(self.device))
        elif type(zeros) == torch.Tensor:
            self.zeros = zeros.clone().detach()
        else:
            self.zeros = torch.Tensor(zeros).long()
            self.zeros = self.zeros.to(torch.device(self.device))

class CutRBM(RBM):
    '''
    RBM for evaluating MaxCUT problems
    '''
    def __init__(self, fname, temperature=1, coupling=10):
        '''
        fname is file to MaxCUT data from
        coupling is the graph embedding coupling parameter
        '''
        f = open(fname, 'r')
        #First Line is parameters, number of vertices and number of edges
        params = f.readline()[:-1].split("\t")
        params = list(map(int, params))
        super().__init__(params[0], params[0], 1)
        self.num_vertices = params[0]
        self.num_edges = params[1]
        self.weights = torch.zeros_like(self.weights)
        self.visible_bias = torch.zeros_like(self.visible_bias)
        self.hidden_bias = torch.zeros_like(self.hidden_bias)
        self.temperature = temperature
        self.coupling = coupling
        #Adjacency matrix
        self.adj = torch.zeros(params[0], params[0])

        for line in f:
            inds = line[:-1].split("\t")
            #First two indices
            inds[0] = int(inds[0])
            inds[1] = int(inds[1])
            #Weight value between them (can be float or int)
            inds[2] = float(inds[2])
            self.weights[inds[0]-1, inds[1]-1] = inds[2]
            self.weights[inds[1]-1, inds[0]-1] = inds[2]
            #keeping track of the adjacency matrix before we do modifications on it
            self.adj[inds[0]-1, inds[1] - 1] = inds[2]
            self.adj[inds[1]-1, inds[0] - 1] = inds[2]

        for i in range(self.num_visible):
            self.weights[i, i] = -1 * coupling

        #This inverts the weight matrix (so that cuts are incentivized)
        self.weights = -1 * self.weights

        #Going from a s = {-1, 1} to s = {0, 1}
        self.visible_bias = temperature * 2*(self.visible_bias - torch.matmul(self.weights.t(), torch.ones(self.num_visible)))
        self.hidden_bias = temperature * 2*(self.hidden_bias - torch.matmul(self.weights, torch.ones(self.num_hidden)))
        self.weights = temperature * 4*self.weights

        f.close()
        
    def cut_value(self, state):
        '''
        Takes a state and returns the value of the cut created by
        partitioning through those states
        '''
        '''
        cut = 0
        for i in range(self.num_visible):
            outgoing_edges = self.adj[i, :]
            for j in range(i):
                if outgoing_edges[j] != 0:
                    #states are on different side of cut
                    if state[i] != state[j]:
                        cut += 1
        '''
        adj = self.adj.cpu().numpy()
        if type(state) == torch.Tensor:
            state = state.cpu().numpy()
        return CutRBM.cut_value_jit(adj, self.num_visible, state)
    
    @jit(nopython=True, cache=True)
    def cut_value_jit(adj, num_visible, state):
        cut = 0
        for i in range(num_visible):
            outgoing_edges = adj[i, :]
            for j in range(i):
                if outgoing_edges[j] != 0:
                    if state[i] != state[j]:
                        cut += 1
        return cut

def compare_weight_matrix(input_path, val):
    rbm = CutRBM(input_path)
    
    print((rbm.weights - val).sum())
    
    
